import React from 'react'
import {connect} from 'react-redux';
import {isClicked, viewStock} from '../redux/actions.js';
import {Link} from 'react-router-dom';
 function SearchElement({products,name,viewStock}) {
       const symbol=products.find(element=>element.longName===name).symbol;
       
    return (

       
       <div  className="search-element">
           <Link className="search-link" to='/stock/' onClick={(e)=>{viewStock(symbol);isClicked(true)}}>  
            {name} </Link>
        </div>
     
       
    )
}
const mapStateToProps=state=>{
    return{
        products:state.trade.products
    }
    
}
const mapDispatchToProps=dispatch=>{
    return{
       
        viewStock:(id)=>{
            dispatch(viewStock(id))
        },
        isClicked:(val)=>{
            dispatch(isClicked(val))
        }
    }

}

export default connect(mapStateToProps,mapDispatchToProps)(SearchElement);
